import React from "react";

interface EmotionItemProps {
    emotion_id: number;
    emotion_img: string;
    emotion_des: string;
    onClick?: (emotion: number) => void;
}

const EmotionItem: React.FC<EmotionItemProps> = ({ emotion_id, emotion_img, emotion_des, onClick }) => {
    return (
        <div className="EmotionItem">
            <img src={emotion_img} />
            <span>{emotion_des}</span>
        </div>
    );
};

export default EmotionItem;
